import React, { useState, useEffect } from "react";
import axios from "axios";
import './App.css';

const App = () => {
  const [data, setData] = useState([]);
  const fetchData = async () => {
    const { data } = await axios.get(
      "https://api.nasa.gov/planetary/apod?api_key=t6p3bUynsAH2pO5wHnA9hbeZmuT6FUbby03zEzJw"
    );
    setData(data);
  };
  console.log(data);
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>

        {data.map((item) => {
          return (
            <>

              <div>Name: {item.date}</div>
              <div>Email: {item.title}</div>
              <div>Email: {item.explanation}</div>
              <div>Email: {item.url}</div>
              <hr />
            </>
          );
        })}

    </div>
  );
};

export default App;
